import React from "react";
import "./CartProduct.css";

export default function CartProduct(props) {
  return (
    <div className="product">
      <div className="img">
        <img src={props.product.img} alt="" className="image" />
      </div>
      <div className="info">
        <div className="title">{props.product.title}</div>
      </div>
    </div>
  );
}
